package ch.lukas.filemanager.view;

import java.awt.Image;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.util.Base64;

import javax.imageio.ImageIO;
import javax.swing.ImageIcon;

/**
 * A static class providing Base64-encoded icons
 * @author lukas
 */
public class Icons {
	
	private static final int IMAGE_SIZE = 16;
	
	public static final String FOLDER = "";
	
	// Images source: https://www.flaticon.com/packs/file-types
	public static final String IMAGE = "";
	public static final String TEXT = "";
	public static final String EXECUTABLE = "";
	public static final String ZIP = "";
	public static final String AUDIO = "";
	public static final String VIDEO = "";
	public static final String PDF = "";
	public static final String OTHER = "";
	
	/**
	 * Get the ImageIcon from a Base64-String
	 * @param data the base64-encoded string
	 * @return the icon
	 */
	public static ImageIcon getImageIcon(String data) {
        try {
            byte[] btDataFile = Base64.getDecoder().decode(data);
            BufferedImage image = ImageIO.read(new ByteArrayInputStream(btDataFile));
            return new ImageIcon(image.getScaledInstance(IMAGE_SIZE, IMAGE_SIZE, Image.SCALE_FAST));
        } catch (IOException e) {
            throw new RuntimeException(e.getMessage(), e.getCause());
        }
	}
}
